var contract = web3.eth.contract(abi);

var loadRepContract = function(){

    contract.new({from: primaryAddress, data: code, gas: 2000000}, function(error, result){
        if (error){
            console.log(error);
        }
        if (result.address){
            console.log("REP ontract address: ", result.address);
            repContract = result;
        }
    });
}

//Due to tiny rounding errors totalSupply will very shy of 11 million. Send out dust to complete seeding
var sendDust = function(){
    console.log("Loading balances complete.");
    console.log("Sending Dust.");
    var total = new BigNumber(11000000 * fxp);
    var supply = new BigNumber(repContract.totalSupply.call());
 	var dust = total.minus(supply);
    console.log("Dust amount:", dust / fxp, "ether");
    repContract.setSaleDistribution(['0x0000000000000000000000000000000000000001'], [dust], {from: primaryAddress, gas: 3500000}, function (error, tx) {
        if (error) {
            console.log("error", error);
        } else {
            var txPoll = function(){
                var receipt = eth.getTransactionReceipt(tx);
                if (receipt != null){
                	console.log(receipt)
                    console.log("Rep contract seeded successfully.");
                    return;
                }
                setTimeout(txPoll, 3000);
            };
            txPoll();
        }
    });
}

